import Layout from './Layout';
import { React, useState } from 'react';
import { useLocation, Navigate } from 'react-router-dom';
import styles from '../resources/Results.module.css';
import Constants from '../utility/Constants';
function Result() {
    const location = useLocation();
    const [predConfidence, setPredConfidence] = useState("0%");
    const [predClass, setPredClass] = useState("-");

    if (location.state && location.state.resultData) {
        console.log("Result Data: ", location.state.resultData);
        analyzeResults(location.state.resultData)
    } else {
        alert(Constants.DEFAULT_ERROR_MESSAGE);
        return <Navigate to={Constants.MAIN_PAGE} />
    }
    function analyzeResults(data) {
        if (data.status === 'OK') {
            setPredClass(data.predClass);
            setPredConfidence(data.confidence);
        } else {
            alert(`The test result was inconclusive`);
        }
    }

    return (
        <></>
        // <Layout isHome={false}>
